    public struct RepoId
    {
        public string Owner { get; set; }
        public string Repo { get; set; }

        public RepoId(string owner, string repo)
        {
            Validation.AppThrowArg(string.IsNullOrWhiteSpace(owner) || owner.Length < 3, nameof(owner));
            Validation.AppThrowArg(string.IsNullOrWhiteSpace(repo) || repo.Length < 3, nameof(repo));

            Owner = owner;
            Repo = repo;
        }

        public static bool TryParseGithubUrl(string githubUrl, out RepoId repoId)
        {
            repoId = default(RepoId);

            // var userNameRegex = "[a-zA-Z0-9_\\-]{3,15}";
            // var repoNameRegex = "[A-Za-z0-9_\\.-]+";

            var userNameRegex = ".+";
            var repoNameRegex = ".+";
            var repoUrlValid = Regex.IsMatch(githubUrl ?? "",
                $"https://(www.github.com|github.com)/{userNameRegex}/{repoNameRegex}", RegexOptions.None, TimeSpan.FromSeconds(5));

            if (!repoUrlValid) return false;

            var pathParams = githubUrl.Split("/").ToArray();

            if (pathParams.Length != 5) return false;

            var owner = pathParams[3];
            var repo = pathParams[4];
            var result = new RepoId(owner, repo);

            repoId = result;

            return true;
        }

        public override string ToString()
        {
            return $"Repo: {Repo}; Owner: {Owner}";
        }
    }

