    internal class GithubAPI : IGithubAPI
    {
        /*
(curl https://api.github.com/users/EasyHttp -headers @{'Authorization'='Basic YmJiNjhkNDZjOGU0ODdlNzQwMzA6N2ZiMDE5Njg3MDc3MTVjMThmM2VlM2VjYWVjZWUwMDJiZGNlYTE2OA=='}).headers

clientid:secret
*/
        private static Semaphore semaphore;
        private readonly string AuthorizationHeaderValue = null;

        //https://raw.githubusercontent.com/dlemstra/Magick.NET/main/Readme.md

        static GithubAPI()
        {
            semaphore = new Semaphore(0, 1);
            semaphore.Release(1);
        }

        private IHttpClientFactory httpClientFactory;
        private ICache cache;

        public GithubAPI(
            IHttpClientFactory httpClientFactory,
            IOptions<DNDocsSettings> rsettings,
            ICache cache)
        {
            this.cache = cache;
            var settings = rsettings.Value;
            this.httpClientFactory = httpClientFactory;
            var authSecret = Convert.ToBase64String(Encoding.ASCII.GetBytes($"{settings.GithubOAuth.ClientId}:{settings.GithubOAuth.Secret}"));
            AuthorizationHeaderValue = $"Basic {authSecret}";
        }

        public async Task<IList<GithubDTO.GitRepo>> GetUserRepositories(string userName)
        {
            Validation.AppEx(string.IsNullOrWhiteSpace(userName), "empty username");
            var msg = new HttpRequestMessage(HttpMethod.Get, $"https://api.github.com/users/{userName}/repos");

            var httpResult = await ExecGitHttpRequestAsync(msg);
            var jsonResult = await httpResult.Content.ReadAsStringAsync();

            return JsonConvert.DeserializeObject<IList<GithubDTO.GitRepo>>(jsonResult);
        }

        public string NewestCommitHashForPath(RepoId repoId, string branch, string relativePath)
        {
            //https://api.github.com/repos/FluentValidation/FluentValidation/commits?per_page=2
            //https://api.github.com/repos/FluentValidation/FluentValidation/commits?per_page=1&path=docs

            string url = $"https://api.github.com/repos/{repoId.Owner}/{repoId.Repo}/commits?per_page=1&sha={{0}}&path={{1}}";

            url = UrlEncodeParams(url, branch, relativePath);

            var request = new HttpRequestMessage(HttpMethod.Get, url);
            var response = GitHttpRequest(request);

            Validation.AppEx(!response.IsSuccessStatusCode, "Trying to get github hash - response is not success." + response.StatusCode.ToString());

            var json = response.Content.ReadAsStringAsync().Result;

            var jnode = JsonNode.Parse(json);

            var commitJnode = jnode.AsArray()[0];
            var sha = commitJnode["sha"].ToString();

            return sha;
        }

        public byte[] DownloadFile(RepoId repoId, string branch, string path)
        {
            // https://github.com/dlemstra/Magick.NET/raw/main/Readme.md
            Validation.AppArgStringNotEmpty(branch, nameof(branch));
            Validation.AppArgStringNotEmpty(path, nameof(path));

            var urlWhereFileIs = UrlEncodeParams($"{GithubUrl(repoId)}/raw/{{0}}/{{1}}", branch, path);

            var request = new HttpRequestMessage(HttpMethod.Get, urlWhereFileIs);

            var result = GitHttpRequest(request);

            if (!result.IsSuccessStatusCode)
                Validation.ThrowError($"Failed to download github file: repoid: {repoId}, branch: '{branch}', path: '{path}'.");

            var mem = new MemoryStream();
            result.Content.ReadAsStream().CopyTo(mem);

            return mem.ToArray();
        }

        public void DownloadRepositoryZip(RepoId repoId, string branch, Stream outputStream)
        {
            // https://github.com/dlemstra/Magick.NET/archive/refs/heads/main.zip
            Validation.AppArgStringNotEmpty(branch, nameof(branch));
            var urlWhereIsZip = UrlEncodeParams($"{GithubUrl(repoId)}/archive/refs/heads/{{0}}.zip", branch);
            var whereIsRequest = new HttpRequestMessage(HttpMethod.Get, urlWhereIsZip);
            var cacheKey = $"{nameof(GithubAPI)}_{whereIsRequest}";
            var cached = cache.GetData(cacheKey);

            if (cached != null)
            {
                var ms = new MemoryStream(cached);
                ms.Seek(0, SeekOrigin.Begin);
                ms.CopyTo(outputStream);

                return;
            }

            var result = GitHttpRequest(whereIsRequest);

            Validation.AppEx(!result.IsSuccessStatusCode,
                $"Github repo call not success status code, code: {result.StatusCode}\r\nbody: {result.Content.ReadAsStringAsync().Result}\r\ncontent-length {result.Content.Headers.ContentLength}");

            var memStream = new MemoryStream();
            result.Content.ReadAsStream().CopyTo(memStream);

            cache.Add(cacheKey, memStream.ToArray(), TimeSpan.FromMinutes(3));
            memStream.Seek(0, SeekOrigin.Begin);
            memStream.CopyTo(outputStream);

            // INFO
            // Because in browser github redirects to other location (looking in devtools how downlaod zip repo works)
            // but from the code, redirection not occur and can download directy
            // leaving code maybe will be usefuf

            // Validation.AppEx(result.StatusCode != System.Net.HttpStatusCode.Found, "Trying to find repo zip but result status code != found");
            // Validation.AppEx(result.Headers.Location == null, "Location header is null");

            // var zipUrl = result.Headers.Location;
