            // Validation.AppEx(getZipResult.IsSuccessStatusCode, "Get zip is not success status code");

            // END INFO
        }

        public bool BranchExists(RepoId repoId, string branch)
        {
            Validation.AppArgStringNotEmpty(branch, nameof(branch));

            return HttpHeadOk(UrlEncodeParams($"{GithubUrl(repoId)}/tree/{{0}}", branch));
        }

        public bool FileExists(RepoId repoId, string branch, string fileRelativePath)
        {
            Validation.AppArgStringNotEmpty(branch, nameof(branch));
            Validation.AppArgStringNotEmpty(fileRelativePath, nameof(fileRelativePath));

            return HttpHeadOk(UrlEncodeParams($"{GithubUrl(repoId)}/blob/{{0}}/{{1}}", branch, fileRelativePath));
        }

        public bool FolderExists(RepoId repoId, string branch, string folderName)
        {
            Validation.AppArgStringNotEmpty(branch, nameof(branch));
            Validation.AppArgStringNotEmpty(folderName, nameof(folderName));

            return HttpHeadOk(UrlEncodeParams($"{GithubUrl(repoId)}/tree/{{0}}/{{1}}", branch, folderName));
        }

        public bool RepositoryExists(RepoId repoId)
        {
            return HttpHeadOk($"{GithubUrl(repoId)}");
        }

        private string GithubUrl(RepoId repoid)
        {
            return $"https://github.com/{repoid.Owner}/{repoid.Repo}";
        }

        private string ApiGithubUrl(string controller, RepoId repoId)
        {
            return $"https://api.github.com/{controller}/{repoId.Owner}/{repoId.Repo}";
        }

        private bool HttpHeadOk(string url)
        {
            var request = new HttpRequestMessage(HttpMethod.Head, url);

            var result = GitHttpRequest(request);

            return result.IsSuccessStatusCode;
        }

        private HttpResponseMessage GitHttpRequest(HttpRequestMessage msg)
        {
            try
            {
                // do not allow to many requests
                // to github api
                semaphore.WaitOne();
                Thread.Sleep(1000);

                return ExecGitHttpRequest(msg);
            }
            catch (Exception e)
            {
                throw e;
            }
            finally
            {
                semaphore.Release();
            }
        }

        private async Task<HttpResponseMessage> ExecGitHttpRequestAsync(HttpRequestMessage msg)
        {
            var httpClient = httpClientFactory.CreateClient();
            var request = msg;
            request.Headers.UserAgent.Add(new System.Net.Http.Headers.ProductInfoHeaderValue("DNDocs", "1.0.0.0"));
            request.Headers.UserAgent.Add(new System.Net.Http.Headers.ProductInfoHeaderValue("(+https://www.robiniadocss.com)"));
            request.Headers.Add("Authorization", AuthorizationHeaderValue);

            var result = await httpClient.SendAsync(request);

            Validation.ThrowError(result.Content.Headers.ContentLength > 10 * 1000 * 1000,
                "Content length github request is > 10MB, too big data aborting github request");


            IEnumerable<string> remainingRateLimit;

            if (result.Headers.TryGetValues("X-RateLimit-Remaining", out remainingRateLimit))
            {
                // what to do if exceed (but limit is pretty big 5000 req/hour)?
                Validation.AppEx(remainingRateLimit.Count() != 1, "Github API rate limit: not implemented, header has more than 1 value");
                Validation.ThrowError(int.Parse(remainingRateLimit.Single()) < 2, "System Error: Rate-Limit with external Github API exceeded, cannot proceed");
            }

            // todo what is blocked/bad reqeust response etc.
            // add logging here for this

            return result;
        }

        private HttpResponseMessage ExecGitHttpRequest(HttpRequestMessage msg)
        {
            return ExecGitHttpRequestAsync(msg).Result;
        }

        private string UrlEncodeParams(string formatString, params string[] p)
        {
            for (int i = 0; i < p.Length; i++)
            {
                p[i] = HttpUtility.UrlEncode(p[i]);
            }

            return string.Format(formatString, p);
        }

